import styled  from "styled-components";
import React from "react";
const StartGame=({toggle})=>{
    return(
        <Container>
           <div> <img src="/image/dices1.png" alt="11" /></div>
            <div className="content"> 
                <h1>Dice Game</h1>
                <Button>Play Now </Button>
            </div>
        </Container>
    )

}
export default StartGame;
const Container=styled.div`
max-width: 1180px;
display: flex;
margin: 0 auto;
height: 100vh;
align-items: center;
.content{ 
    h1 {
font-size: 96px;
white-space: nowrap;
    }
}
`
